import React from 'react';
import hydro1 from "../assets/hydro1.png";
import hydro2 from "../assets/hydro2.png";
import dashboard from "../assets/dashboard.png";
import Grid from '@material-ui/core/Grid';


function Features() {
    return (
        <div>
            <Grid container className="features-container" spacing={6}>
                <Grid className="features-image-container" item xs={3}>
                    <img className="features-image" src={hydro1} />
                </Grid>
                <Grid className="features-text-container">
                    <h2></h2>
                </Grid>
                <Grid className="features-image-container" item xs={3}>
                    <img className="features-image" src={hydro2} />
                </Grid>
                <Grid item className="features-image-container" xs={3}>
                    <img className="features-image" src={dashboard} />
                </Grid>

            </Grid>
        </div>
    );
}

export default Features
